import { useEffect, useState } from 'react';

const useServices = () => {
    const services = [
        {
            'id': 1,
            'name': 'Photography'
        },
    ]

    // const [services, setServices] = useState([]);
    // setServices([1, 3, 4]);
    useEffect(() => {
        fetch('services.json')
            .then(res => res.json())
            .then(data => console.log(data));
    }, [services])
    return services;
};

export default useServices;
